CREATE TABLE ophthalmology(
   placeUrl      VARCHAR(435) NOT NULL PRIMARY KEY
  ,title         VARCHAR(65) NOT NULL
  ,rating        NUMERIC(3,1)
  ,reviewCount   INTEGER 
  ,category      VARCHAR(10)
  ,attributes    VARCHAR(30)
  ,address       VARCHAR(99) NOT NULL
  ,plusCode      VARCHAR(20)
  ,website       VARCHAR(93)
  ,phoneNumber   VARCHAR(17)
  ,星期三           VARCHAR(24)
  ,星期四           VARCHAR(24)
  ,星期五           VARCHAR(24)
  ,星期六           VARCHAR(24)
  ,星期日           VARCHAR(11)
  ,星期一           VARCHAR(24)
  ,星期二           VARCHAR(24)
  ,currentStatus VARCHAR(4)
  ,imgUrl        VARCHAR(162)
  ,isClaimed     VARCHAR(5) NOT NULL
  ,latitude      NUMERIC(18,15)
  ,longitude     NUMERIC(18,14)
  ,query         VARCHAR(97) NOT NULL
  ,timestamp     VARCHAR(24) NOT NULL
);
